import 'react-native-gesture-handler';
import React from 'react';
import { ApplicationProvider } from '@ui-kitten/components';
import * as eva from '@eva-design/eva';
import { default as theme } from './custom-theme.json';
import RootNavigator from './src/navigation/RootNavigator';
import * as firebase from 'firebase';

const firebaseConfig = {
  apiKey: "AIzaSyAwrPvi2fVh63LYuxLCXZM-q6TA1Etem-w",
  authDomain: "elbrus-motivashka.firebaseapp.com",
  databaseURL: "https://elbrus-motivashka.firebaseio.com",
  projectId: "elbrus-motivashka",
  storageBucket: "elbrus-motivashka.appspot.com",
  messagingSenderId: "435782827354",
  appId: "1:435782827354:web:0973aa41e197a589e18763",
  measurementId: "G-TWN09XNK24"
};
// Initialize Firebase
firebase.initializeApp(firebaseConfig);
firebase.analytics();

const App = () => {
  return (
    <ApplicationProvider {...eva} theme={{ ...eva.light, ...theme }}>
      <RootNavigator />
    </ApplicationProvider>
  );
};

export default App;
